import Header from '../Header/Header';
import Styles from './HeroBlock.module.scss';


const HeroBlock = () => {
  return (
    <div className={Styles.Block}>
      <Header />
      <div className={Styles.Wrapper}>
          <div>
              <div className="HeroInfo">
                  <div className="HeroInfo__title">

                  </div>
                  <div className="HeroInfo__subtitle">

                  </div>
                  <div className="HeroInfo__button">
                      Оставить заявку
                  </div>
              </div>
              <div className="HeroFeature">
                  <div className="HeroFeature__image"></div>
                  <div className="HeroFeature__features"></div>
              </div>
          </div>
          <div></div>
      </div>
    </div>
  );
};

export default HeroBlock;
